-glob\n \t不在 FTP 文件名中使用通配符展开\n--no-passive-ftp\n\t禁用 passive 传输模式\n--retr-symlinks\n\t递归目录时，获取符号链接指向的文件\n\n递归下载选项\n-r,  --recursive\n\t指定递归下载\n-l,  --level=NUMBER\n\t最大递归深度 (inf 或 0 代表无限制，即全部下载)\n--delete-after\n\t下载完成后删除本地文件\n-k,  --convert-links\n\t让下载得到的 HTML 或 CSS 中的链接指向本地文件\n-K,  --backup-converted\n\t在转换文件 X 前先将它备份为 X.orig\n-m, --mirror\n\t打开适合镜像的选项。此选项打开递归和时间戳，设置无限递归深度，并保留ftp目录列表。等价于 -N -r -l inf --no-remove-listing 选项\n-p,  --page-requisites\n\t下载所有用于显示 HTML 页面的图片之类的元素\n--strict-comments\n\t用严格方式 (SGML) 处理 HTML 注释\n\n递归接受/拒绝选项\n-A,  --accept=LIST\n\t逗号分隔的可接受的扩展名列表\n-R,  --reject=LIST\n\t逗号分隔的要拒绝的扩展名列表\n-D,  --domains=LIST\n\t逗号分隔的可接受的域列表\n--exclude-domains=LIST\n\t逗号分隔的要拒绝的域列表\n--follow-ftp\n\t跟踪 HTML 文档中的 FTP 链接\n--follow-tags=LIST\n\t逗号分隔的跟踪的 HTML 标识列表\n--ignore-tags=LIST\n\t逗号分隔的忽略的 HTML 标识列表\n-H,  --span-hosts\n\t递归时转向外部主机\n-L,  --relative\n\t只跟踪有关系的链接\n-I,  --include-directories=LIST\n\t允许目录的列表\n--trust-server-names\n\t在重定向时，重定向 URL 的最后一个组件将用作本地文件名。默认情况下，它是原始 URL 中的最后一个组件\n-X,  --exclude-directories=LIST\n\t排除目录的列表\n-np, --no-parent\n\t不追溯至父目录\n--ignore-case\n\t匹配文件/目录时忽略大小写\n"
